<script>
    // Greensock
    var tl = new TimelineMax();

    tl.add(
        TweenMax.to('.video-container', 1, {scale: 1, transformOrigin: "50%, 50%", ease:Power2.easeInOut})
    )

    tl.add(
        TweenMax.to(".svg-container", 1, {opacity: 0, scale: 50, transformOrigin: "50%, 50%", ease:Power2.easeInOut}),
        "-=1"
    )

    // ScrollMagic
    var controller = new ScrollMagic.Controller();

    // container pin
    var startpin = new ScrollMagic.Scene({
        duration: 1200
    })
        .setPin(".hero-container")
        .addTo(controller);

    // tween
    new ScrollMagic.Scene({
        duration: 500
    })
        .setTween(tl)
        .addTo(controller);

    $('.video-container-text').fadeOut("fast");
    $(document).scroll(function() {
        var y = $(this).scrollTop();
        var wheight = window.innerHeight;
        // console.log(y);
        if (y > wheight/2) {
            $('.video-container-text').fadeIn();
        } else {
            $('.video-container-text').fadeOut();
        }
    });
</script>